import React , {Component} from 'react';

class TableHead extends Component{
    render(){
        return(
            <thead>
            <tr>
                <th>#</th>
                <th>Статус</th>
                <th>Действие</th>
                <th>Описание</th>
            </tr>
        </thead>
        )
    }
}
